import React from "react";

export default function Skills(){
    return (
        <div>
            <ul>
                <li>Experience in web, server, and desktop application development using Javascript, React,
                    Angular, HTML5, CSS, Python, Delphi, Java, and other languages. </li>
                <li>Technical knowledge of computer hardware and software with experience in computer troubleshooting and repair. </li>
                <li>Experience in network and telecom administration.</li>
                <li>Also familiar with languages including: Visual Basic, C, C++, SQL.</li>
                <li>Knowledge of Windows and Linux systems, Microsoft Office, Citrix, Cisco systems, Active Directory.</li>
            </ul>
        </div>
    );
}
